import React from 'react';

function MyBookingsPla({ location }) {
  const { state } = location;

  return (
    <div>
      <h1>My Bookings Page</h1>
      <ul>
        {state.clickedButtons.map((button, index) => (
          <li key={index}>{button}</li>
        ))}
      </ul>
    </div>
  );
}

export default MyBookingsPage;
